    // updateAppliance function
    //
    // Updates the latest cp12 object from the cti store space
    updateAppliance(appliance) {
        if (appliance.sAlarmType) {
            for (var i in window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyAlarms) {
                if (window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyAlarms[i].id == appliance.id) {
                    window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyAlarms[i] = appliance;
                    break;
                }
            }
        }
        if (appliance.sApplianceType) {
            for (var i in window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyGasAppls) {
                if (window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyGasAppls[i].id == appliance.id) {
                    window.cti.store.jobs.selectedJob.aPropertyDetail.aPropertyGasAppls[i] = appliance;
                    break;
                }
            }
        }
        return true;
    }
