    countProperties(obj) {
        var count = 0;
        for (var prop in obj) {
            if (obj.hasOwnProperty(prop))
                ++count;
        }
        return count;
    }
    // returnGasAppliances function
    //
    // Return list of appliances for adding new appliance
    sortApplianceLists(returnType, value) {
        var appliances = this.returnGasAppliances();
        if (returnType == 'make') {
            var make = [];
            for (var i = appliances.length - 1; i >= 0; i--) {
                var thisAppliance = appliances[i];
                if (make.length != 0) {
                    var exists = false;
                    for (var x in make) {
                        var thisMake = make[x];
                        if (thisMake.Make == thisAppliance.Make) {
                            exists = true;
                        }
                    }
                    if (!exists) {
                        make.push({ Make: thisAppliance.Make });
                    }
                }
                else {
                    make.push({ Make: thisAppliance.Make });
                }
            }
            var makeList = make.sort();
            return makeList;
        }
        else if (returnType == 'model') {
            var model = [];
            for (var i = appliances.length - 1; i >= 0; i--) {
                var thisAppliance = appliances[i];
                if (thisAppliance.Make == value) {
                    model.push({ MODEL: thisAppliance.MODEL, GCNo: thisAppliance.GCNo });
                }
            }
            var modelList = model.sort();
            return modelList;
        }
    }
