    // returnQuestionList function
    //
    // Parameter    section     (defines the section within the CP12 to return the data)
    //
    // returns the latest cp12 object from the cti store space
    returnQuestionList(section) {
        if (section == 'tightnessTestOne') {
            return {
                VAL61_LETBY: true,
                VAL46_BWIP: true,
                VAL47_BWATM: true,
                VAL54_BWLTM: true,
                VAL48_BWPF: true,
                VAL76_TRACEREPAIR: true,
                VAL77_METERISOLATED: true,
                VAL78_WORKPRESS: true,
                VAL83_WORKPRESSCMTS: true,
                VAL62_METERLOCATION: true
            };
        }
        else if (section == 'tightnessTestTwo') {
            return {
                VAL49_AWIP: true,
                VAL50_AWATM: true,
                VAL55_AWLTM: true,
                VAL51_AWPF: true
            };
        }
        else if (section == 'firstChecks') {
            return {
                VAL60_VISINSPECTONLY: true,
                GCNO: true,
                SERIALNO: true,
                WARRANTYDATE: true
            };
        }
        else if (section == 'secondChecks') {
            return {
                CANSERVICE: true,
                LANDLORDOWN: true,
                INSPECTED: true
            };
        }
        else if (section == 'thirdChecks') {
            return {
                FLUETYPE: true,
                VAL54_FLUEBOXED: true,
                VAL55_HATCHES: true,
                VAL56_CODETFITTED: true,
                VAL57_CANINSTALLCODET: true,
                VAL59_CODETQTY: true,
                VAL58_NOINSTALLREASON: true
            };
        }
        else if (section == 'warningChecks') {
            return {
                WARNINGNO: true,
                REMEDIALACTIONTAKEN: true
            };
        }
        else if (section == 'fourthChecks') {
            return {
                OPPRESSURE: true,
                OPPRESSUNIT: true,
                INITCOMBREAD: true,
                FINCOMBREAD: true,
                VAL50_CORATIO: true
            };
        }
        else if (section == 'fifthChecks') {
            return {
                VAL51_SPILLTEST: true,
                VAL52_FFTEST: true,
                VAL53_PFTEST: true,
                SAFEDEVCORRECTOP: true,
                VENTPROVSAT: true,
                VISCONDCHIMSAT: true
            };
        }
        else if (section == 'sixthChecks') {
            return {
                FLUEPERFCHECKS: true,
                SAFETOUSE: true
            };
        }
        else if (section == 'defectChecks') {
            return {
                DESCRIBEDEFECTS: true,
                DEFECTWARNINGSELECT: true,
                WARNINGNO: true,
                REMEDIALACTIONTAKEN: true
            };
        }
        else if (section == 'seventhChecks') {
            return {
                DEFECTS: true
            };
        }
        else if (section == 'eighthChecks') {
            return {
                VAL61_APPNOTES: true
            };
        }
        else if (section == 'firstAlarmChecks') {
            return {
                LOCATION: true,
                FITTED: true,
                INDATE: true,
                NEWFITTED: true
            };
        }
        else if (section == 'secondAlarmChecks') {
            return {
                SATTEST: true,
                POWER: true,
                VAL12_BATTCHANGED: true
            };
        }
        else if (section == 'thirdAlarmChecks') {
            return {
                VAL7_VISINSP: true,
                VAL8_CHANGED: true,
                VAL9_CONNTOCIR: true,
                VAL10_BACKUPOK: true,
                VAL11_VACCLEAN: true,
                SATTEST: true,
                VAL13_SUPPRECON: true
            };
        }
        else if (section == 'fourthAlarmChecks') {
            return {
                VAL14_COMMENTS: true
            };
        }
        else if (section == 'firstAdditionalChecks') {
            return {
                VAL52_PWVISINSPECT: true,
                ECVACCESSIBLE: true,
                VAL53_EBEVIDENT: true
            };
        }
        else if (section == 'secondAdditionalChecks') {
            return {
                VAL79_RADSTESTED: true,
                VAL80_LIFEBOILER: true,
                VAL81_LIFESYSTEM: true
            };
        }
        else if (section == 'thirdAdditionalChecks') {
            return {
                CYLINDERPRESENT: true,
                CYLINDERCHECKED: true,
                SHOWERFITTED: true,
                SHOWEROWNER: true
            };
        }
    }
